import { TextField } from '@material-ui/core'
import Autocomplete from '@material-ui/lab/Autocomplete';
import React from 'react'
import { IAutocompleteItem } from '../../_interfaces/IAutocompleteItem';
import InputTextField from './InputTextField';

interface IProps{
    items: IAutocompleteItem[]
    filterText: string
    handleFilterText: (txt: string) => void
}

const AutocompleteInput: React.FC<IProps> = (props) =>{

    const {items, filterText, handleFilterText} = props

    const [selectedItem, setSelectedItem] = React.useState<IAutocompleteItem|null>(null)

    // const onChange = React.useCallback((e: React.ChangeEvent<{}>, item: any) =>{
    //     console.log(item.label)
    // },[handleFilterText])

    return(
        <Autocomplete
            options={items}
            noOptionsText="???"
            getOptionLabel={(x) => x.label}
            onChange={(e: React.ChangeEvent<{}>, item: IAutocompleteItem | null) => {setSelectedItem(item)}}
            renderInput={(params) => <TextField {...params} value={filterText} />}
            />
    )
}

export default AutocompleteInput
